import React, { useEffect } from "react";

export default function Main() {
  useEffect(() => {
    document.addEventListener("DOMContentLoaded", () => {
      const xer = document.getElementsByClassName("DjLogoBrand");
      xer[0].classList.add("transform0");
    });
    /*     const xer = document.getElementsByClassName("DjLogoBrand");
    xer[0].classList.remove("transform0"); */
  }, []);

  return (
    <div>
      <img
        src="./img/MainDJBrand.png"
        alt="logo DJ Brand"
        className="DjLogoBrand transform0"
      />
    </div>
  );
}
